  false,\n\t\"url\": null,\n\t\"notes\": \"The Digital Geologic Map of Glacier National
  Park, Montana is comprised of GIS data layers, two ancillary GIS tables, a Windows
  Help File with ancillary map text, figures and tables, GIS data layer and table
  FGDC metadata and ArcView 3.X legend (.AVL) files. The data were completed as a
  component of the Geologic Resources Evaluation (GRE) program, a National Park Service
  (NPS) Inventory and Monitoring (I&M) funded program that is administered by the
  NPS Geologic Resources Division (GRD). All GIS and ancillary tables were produced
  as per the NPS GIS-Geology Coverage/Shapefile Data Model (available at: http://science.nature.nps.gov/im/inventory/geology/GeologyGISDataModel.htm).
  The GIS data is available as coverage and table export (.E00) files, and as a shapefile
  (.SHP) and DBASEIV (.DBF) table files. The GIS data projection is NAD83, UTM Zone
  12N. That data is within the area of interest of Glacier National Park.\",\n\t\"license_title\":
